with open('taxe.in', 'r') as fin, open('taxe.out', 'w') as fout:
    s, n = map(int, fin.readline().split())
    grid = [list(map(int, fin.readline().split())) for _ in range(n)]
    dp = [[0] * n for _ in range(n)]
    dp[0][0] = s - grid[0][0]
    for i in range(n):
        for j in range(n):
            if i > 0:
                dp[i][j] = max(dp[i][j], dp[i - 1][j] - grid[i][j])
            if j > 0:
                dp[i][j] = max(dp[i][j], dp[i][j - 1] - grid[i][j])
    if dp[n - 1][n - 1] >= 0:
        fout.write(str(dp[n - 1][n - 1]))
    else:
        fout.write('-1')
